import React from 'react'
import {Button, Tabs} from "antd";


const { TabPane } = Tabs;

const operations = <Button>Export File</Button>;

class individualTab extends react.Component{
    render(){
        const {myProp} = this.props;
        return(
            <TabPane tab="Developmental Consultation" key="1">
                Content of tab 1
            </TabPane>
        )
    }
}

class TabProp extends React.Component {
    render(){
        return(
            <div>
                <Tabs tabBarExtraContent={operations}>
                    <TabPane tab="Developmental Consultation" key="1">
                        Content of tab 1
                    </TabPane>
                    <TabPane tab="Tab 2" key="2">
                        Content of tab 2
                    </TabPane>
                    <TabPane tab="Tab 3" key="3">
                        Content of tab 3
                    </TabPane>
                </Tabs>,
            </div>
        )
    }


}
export default TabProp
